import axios from "axios"
import { useState } from "react"
import { useNavigate } from "react-router-dom"
function AddProdact(){
const[title,setTitle]=useState("")
const[price,setPrice]=useState(0)
let usenav=useNavigate()
function FormSubmit(e){
e.preventDefault()
axios.post("http://localhost:9000/prodact",{
title,price
})
  .then((data)=>{
    
    usenav("/Prodacts")
  })
}
return(
<div>
<h1>AddProdact</h1>
<form onSubmit={FormSubmit}>
<div className="mb-3">
<label htmlFor="exampleInputEmail1" className="form-label">Title </label>
<input onChange={(e)=>setTitle(e.target.value)} type="text" placeholder="Prodact Title" className="form-control" id="exampleInputEmail1" aria-describedby="prodact Title" />
</div> 
<div className="mb-3">
<label htmlFor="exampleInputEmail1" className="form-label">Price </label>
<input onChange={(e)=>setPrice(e.target.value)} type="text" placeholder="Prodact Price" className="form-control" id="exampleInputEmail1" aria-describedby="prodact Title" />
</div> 
<button type="submit" className="btn btn-primary">Add</button>
</form>
</div>
)
}
export default AddProdact
